import './PublicProductStyle.css'
import heartIcon from './img/heartIcon.png'
// ProductCard의 내부 jsx
function ProductCardList({ item }) { 
    return (
        <div>
            <img className='productImg' src={item.images[0]} alt={item.tags} />
            <div>
                <h3 className='productName productColor'>{item.name}</h3>
                <p className='productPrice productColor'>{item.price}</p>
                <div>
                    <img  src={heartIcon} alt='하트 아이콘' />
                    <p>{item.favoriteCount}</p>
                </div>
            </div>
        </div>
    );
} 

function ProductCard({ items }) {
    return (
        <ol>
            {items.map((item) => (
                <li key={item.id}>
                    <ProductCardList item={item}/>
                </li>
            ))}
        </ol>
    );
}

export default ProductCard;
